- input: "TEXT\x1CC00161786\x1CTEXT-00000\x1C\x1CF3XN\x1CDetermination of usual and
    normal charges for Enhanced Online Voter File Access for payments received on
    Schedule A, Line 17 of the Committees report was calculated by the total cost
    of developing and hosting our online voter file and dividing it by the number
    of records within the file as well as the presumed number of overall users.  The
    cost to the organization is then determined by the number of records requested
    and the length of time access will be granted.  i.e. Statewide or congressional
    charges are based on the number of records in the district or entire state as
    requested.  -  Please note that the employees that were disclosed on Schedule
    H4 supporting Line 21(a) as payroll spent less than 25% of their time during the
    period working on any Federal Election Activity or activities in connection with
    a Federal Election therefore salary payments were allocable.  This also includes
    fringe benefits for those specific employees.  -  Please note that all fundraising
    activity on this report was for the sole benefit of the Committee and was not
    attributable to any candidate for federal office.  -  Additionally the Column
    B Totals on this report reflect changes due to an exhaustive search in the Committee
    database for duplicates caused by data entry errors from 3 web based contributions
    received.  Cari Carpenter Contributed $300 on 1/11/09 that was itemized and also
    gave $10 on 1/27/09 that was not itemized so her new aggregate year to date total
    is $310  -  Harold Hurst contributed $180 on 3/3/09 that was not itemized and
    in the duplicate record contributed $60 on 3/12/09; his aggregate year to date
    total is now $240  -  Ginny Sue Hayden had contributed $200 in January that was
    not itemized and then $35 on 3/13/09 which was itemized as $235 on the April Monthly
    Report.  Ms. Hayden then contributed online again on 4/1/09 which created the
    duplicate.  This has been corrected and her aggregate year to date total is $270.
    \ Due to these merges the Column B Itemized Total has increased by $105 and the
    Unitemized Total has decreased by $105\n"
